function initPushwoosh(){var pushNotification=window.plugins.pushNotification;pushNotification.onDeviceReady();document.addEventListener('push-notification',function(event){var title=event.notification.title;var userData=event.notification.userdata;if(typeof(userData)!="undefined"){console.warn('user data: '+JSON.stringify(userData));}navigator.notification.alert(title);pushNotification.stopGeoPushes();});}function registerPushwoosh(){var pushNotification=window.plugins.pushNotification;pushNotification.registerDevice({projectid:"951135612128",appid:"2A0A5-F4D2A"},function(token){onPushwooshInitialized(token);},function(status){});}function unregisterPushwoosh(){var pushNotification=window.plugins.pushNotification;pushNotification.unregisterDevice(function(token){},function(status){});}function onPushwooshInitialized(pushToken){console.warn('push token: '+pushToken);var pushNotification=window.plugins.pushNotification;pushNotification.getTags(function(tags){console.warn('tags for the device: '+JSON.stringify(tags));},function(error){console.warn('get tags error: '+JSON.stringify(error));});pushNotification.setLightScreenOnNotification(false);pushNotification.setTags({deviceName:"hello",deviceId:10},function(status){console.warn('setTags success');},function(status){console.warn('setTags failed');});function getCurrentPosition(){navigator.geolocation.getCurrentPosition(geolocationSuccess,geolocationError);}pushNotification.startGeoPushes();}var app={initialize:function(){this.bindEvents();},bindEvents:function(){document.addEventListener('deviceready',this.onDeviceReady,false);},onDeviceReady:function(){initPushwoosh();app.receivedEvent('deviceready');},receivedEvent:function(id){var parentElement=document.getElementById(id);var listeningElement=parentElement.querySelector('.listening');var receivedElement=parentElement.querySelector('.received');listeningElement.setAttribute('style','display:none;');receivedElement.setAttribute('style','display:block;');console.log('Received Event: '+id);}};